import { Component } from "react";
import React, { useState, useRef, useEffect } from 'react';
import {View,Button,TextInput,Text,Alert,StyleSheet, Header,Image } from 'react-native'
import AuthStyle from './AuthStyle'
import { connect } from 'react-redux';


import { Icon } from 'native-base'

import instalogo from './insta.png'

import dm from './dm.png'




class Home extends Component {


    static navigationOptions = ({ navigation }) => ({
        title: "My Profile!",
        headerRight: (<Text>Salaaam</Text>),
      });


    render() {
        return (
            <View style={{flex:1, height :100 , backgroundColor : "white"}}>
                <Image source = {instalogo} style = {{width : 120 , height : 35 ,marginLeft : 20 , tintColor : "black", marginTop : 30 , marginBottom :5}}   ></Image>
                <Image source = {dm} style = {{width : 30 , height : 30 , marginRight : 20 , alignSelf : "flex-end" , tintColor : "black", marginTop : 10 , marginBottom :5}}   ></Image>
            </View>

        );
    }






}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center'
    }
});


const mapStateToProps = state => {
    return {
        authToken: state.loginReducer.authToken,
    }
  }



export default Home;
